import React, {Component} from 'react'
import './App.css'

export default class Nav extends Component {
    render() {
        return(
            <nav className='navBar'>
                <ul>
                <li>Home</li>
                <li>About</li>
                <li>Products</li>
                <li>Contact</li>
                </ul>
            </nav>
        );
    }
}
